"use strict";

function f_gold(customers, grumpy, minutes) {
    let s = customers.reduce((acc, val, i) => acc + val * grumpy[i], 0);
    let cs = customers.reduce((acc, val) => acc + val, 0);
    let t = 0;
    let ans = 0;
    for (let i = 0; i < customers.length; i++) {
        let a = customers[i];
        let b = grumpy[i];
        t += a * b;
        if (i >= minutes) {
            let j = i - minutes;
            t -= customers[j] * grumpy[j];
        }
        if (i >= minutes - 1) {
            ans = Math.max(ans, cs - (s - t));
        }
    }
    return ans;
}
